import React from 'react';
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import Container from "react-bootstrap/Container";

function Navigation() {
    return (
    <Navbar sticky="top" expand="lg" bg="dark">
        <Container>
            <Navbar.Brand className="Nav-text">ANI</Navbar.Brand>
            <Navbar.Toggle aria-controls="responsive-navbar-nav" />
            <Nav className='nav'>
                <Nav.Link className="Nav-text" href="./About">About Me</Nav.Link>
                <Nav.Link className="Nav-text" href="./Experience">Experience</Nav.Link>
                <Nav.Link className="Nav-text" href="./Contact">Contact Me</Nav.Link>
            </Nav>
        </Container>
    </Navbar>)
}

export default Navigation;
